import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //获取用户信息
     get_UserList: { url: '/user/GetUserList', method: 'post' },
     //删除用户信息
     get_DeleteUser: { url: '/user/DeleteUser', method: 'post' },
     //获取用户选择框
     get_UserListSelect: { url: '/user/GetUserListSelect', method: 'post' },
     //上传信息
     upload: { url: '/user/upload', method: 'post' },
     //测试信息
     ppp: { url: '/employeesService/ppp', method: 'post' },
}, config.pgyerApiUrl);
